import React from 'react';
import '../styling/Navigation.css';
import {Link} from 'react-scroll';
import {AiOutlinePhone} from 'react-icons/ai';

export default function NavigationBar() {

    return <>
        <div class="navbar-container">
                <Link to="home-container" smooth={true} class="navbar-logo">Idea</Link>
            <div class="navbar-links">
                <Link to="about-container" smooth={true} class="links">About Me</Link>
                <Link to="about-container"  smooth={true} class="links">Education</Link>
                <Link to="work-container" smooth={true} class="links">Experience</Link>
                <Link to="projects-container" smooth={true} class="links">Projects</Link>
                <Link to="footer-container" smooth={true} class="links">
                    <AiOutlinePhone size={50}/>
                    <p className='link-label'>Contact</p>

                </Link>
            </div>
        </div>
        <style jsx>{`
            .link-label {
                font-size: 10px;
            }

        `}</style>
    </>
}
